style.css:
@-moz-document domain("poezd.rw.by") {
.commandExButton, .commandExRedButton {
  float: none !important;
}

.topline {
  display: none !important;
}

#top {
  background-color: #81c4ff !important;
}

#top div {
  height: auto !important;
}

#top .user {
  padding-top: 0 !important;
}

#top, #top div, #top td {
  background-image: none !important;
}

#top img {
  display: none !important;
}

/* [value="Сбросить"] */
.commandExRedButton[id$=":form1:buttonCancel"] {
  display: none !important;
}

form.form div[style*="width:100%;height:500px;"] {
  height: 250px !important;
}
 
.tabs div div div {
    padding-left: 10px;
    padding-right: 10px;
}
 
.tabs a {
    background-image: none;
    padding-right: 0;
}
}
